  `deleted` tinyint(1) DEFAULT '0' COMMENT '删除状态',
  `page` varchar(50) DEFAULT NULL COMMENT '页面组件',
  `path_param` varchar(50) DEFAULT NULL COMMENT '路径参数',
  `layout` varchar(10) DEFAULT NULL COMMENT '布局',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='菜单';
